import React from 'react';
import "../assets/css/templatemo-style.css";

export default function History () {
  return (
    <div className="tm-container-inner tm-history">
    <div className="row">
      <div className="col-12">
        <div className="tm-history-inner">
          <img src="img/sejarah-2.jpg" alt="Image" className="img-fluid tm-history-img" />
          <div className="tm-history-text"> 
            <h4 className="tm-history-title">Sejarah Warong Kampoeng</h4>
            <p className="tm-mb-p">Dulu skali, owner pe mama pe papa bajual makanan for smokol pagi. Bersyukur skali, pe banya tu orang yang babeli. Waktu itu masih bajual dimuka rumah, mar karena rame skali orang ja babeli akhirnya torang pindah di kios yang torang sewa. Dari situ boleh mo kase skolah owner pe mama deng sudara yang laeng. Abis itu, ni kios dapa kase waris pa owner selaku cucu pertama. Puji Tuhan skali, dari yang dulu masih bajual di kios kacili, skarang so buka cabang di tampa laeng. Smua karena Tuhan pe bae...</p>
          </div>
        </div>	
      </div>
    </div>
    </div>
  )
}
